import React from 'react';

const Lodging = () => {

  return (
    <main>
      <h1> Lodging </h1>
      <div className="row">
        <div className="column">
          <p>Different Lodging Options</p>
        </div>
        <div className="column">
          <iframe src="https://www.google.com/maps/d/embed?mid=1z5UcYpc_Be-fVbqVHDH7CmKRF7PVyicV&hl=en" width="640" height="480"></iframe>
        </div>
      </div>
    </main>
  );
};

export default Lodging;
